import logo from './logo.svg';
import './App.css';

import { BrowserRouter as Router,Route,Routes } from 'react-router-dom';
import Home from './Home';

function App() {
  return (
    <>
      This is my App component
      <Router>
        <Routes>
          <Route exact path = "/">
            <Home />
          </Route>
          </Routes>
      </Router>
    </>
  );
}

export default App;
